import React, { Component } from 'react';
import './App.css';

import axios from 'axios';

class App extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}

	componentDidMount() {}

	render() {
		return <h1>Hello World</h1>;
	}
}

export default App;
